import React, { useEffect, useState } from "react";
import SignleReport from './SingleReport';

function ReportDashboard() {
    const [reps, setReps] = useState([{
        id: '',
        state: '',
        reportType: '',
        message: ''
    }])

    useEffect(() => {
        fetch("/reportdashboard")
            .then(res => {
                return res.json()

            }).then(jsonRes =>
                setReps(jsonRes));

    })

    return <div className="container">
        <h2>Report Dashboard</h2>
        
        {reps.map(rep =>
            <SignleReport key={rep.id} state={rep.state} reportType={rep.reportType} message={rep.message} reps={reps} setReps={setReps} />
        )}
         <Button  color="primary">Resolve</Button>

<Button onClick={deleteHandler} color="danger">Block</Button>
    </div>
}

export default ReportDashboard;
